import { Card } from "antd";

function TestCard() {
  return (
    <div>
      <Card
        headStyle={{
          color: "white",
          background: "#3E3D40",
        }}
        title={
          <div>
            <b>SSID: </b>Aegis Research
          </div>
        }
        style={{
          width: "100%",
          overflow: "hidden",
          color: "white",
          margin: "0 auto",
        }}
        bodyStyle={{ background: "#1F1E26" }}
      >
        <table
          style="width:100%; padding: 5px;
  text-align: left; "
        >
          <tr>
            <th>Device Status:</th>
            <td>ACTIVE</td>
          </tr>
          <tr>
            <th>Device Status:</th>
            <td>WorkStation PC</td>
          </tr>
          <tr>
            <th>OS Version:</th>
            <td>Windows 10 Enterprise</td>
          </tr>
          <tr>
            <th>MAC Address:</th>
            <td>aa:bb:cc:dd:ee:ff</td>
          </tr>
        </table>
      </Card>
    </div>
  );
}

export default TestCard;
